import React, { Component } from 'react'
import { Link } from 'react-router-dom';




class AdminPannel extends Component {
    render(){

        return (

            <div class="container-fluid">
            <div class="row">
              <div class="col-sm-6 login-section-wrapper">

                <div class="login-wrapper my-auto">
                  <h1 class="login-title">Log in</h1>
                  <li className="collection-item" ><div><h4 >Add New Election<Link to="/newElection" className="secondary-content"></Link></h4></div></li>
                  <li className="collection-item" ><div><h4 >Election List<Link to="/elections" className="secondary-content"></Link></h4></div></li>

                </div>
              </div>
              <div class="col-sm-6 px-0 d-none d-sm-block">
                <img src="login.jpg" alt="login image" class="login-img"/>
              </div>
            </div>
          </div>
        )
    }
}

export default AdminPannel;
